CREATE TABLE `membership` (
  `mem_id` int NOT NULL,
  `g_code` int NOT NULL,
  `start_date` date NOT NULL,
  `end_date` date DEFAULT NULL,
  `level_code` int NOT NULL,
  `lock_num` int DEFAULT NULL,
