  CONSTRAINT `fk_mb_lvl` FOREIGN KEY (`level_code`) REFERENCES `status_level` (`level_code`),
  CONSTRAINT `fk_mem` FOREIGN KEY (`mem_id`) REFERENCES `member` (`mem_id`)
