CREATE VIEW Olias_Attendies AS
select concat(M.fname, " ", M.lname)
from member M join enrollment E on M.mem_id = E.mem_id
		      join class C on E.c_code = C.class_code
		      join trainer T on C.t_id = T.t_id
			  join employee EM on T.emp_id = EM.emp_id
where T.t_id = 9;

CREATE VIEW Conditioning_class_members AS 
select concat(m.fname, " ", m.lname)
from member m join enrollment e on m.mem_id = e.mem_id
	          join class c on e.c_code = c.class_code
			  join trainer t on c.t_id = t.t_id
where specialty = "conditioning";

CREATE VIEW Trainers_with_classes_lead AS 
select count(*) as "Number of Classes Led",
EMP_Fname as "First Name", EMP_Lname as "Last Name",
hireDate as "Date Hired"
from class join trainer on class.t_id = trainer.t_id
	join employee on trainer.emp_id = employee.emp_id
group by class.t_id;

CREATE VIEW Top_vendors_for_gym_3 AS
select v.name, v.c_fname, v.c_lname, email
from vendor v join equipment e on v.v_code = e.v_code
	join inventory i on e.equip_id = i.eq_code
    join gym g on i.g_code = g.g_code
#where g.g_code = 3
group by v.v_code
order by count(*) desc limit 3;

CREATE VIEW Total_Wages_Earned AS
select e.emp_id, e.g_code, concat("$", convert(format(sum(timediff(clock_out, clock_in)) / 10000 * wage, 2) using utf8))
from timesheet t join employee e on t.emp_id = e.emp_id
where e.emp_id in (select emp_id from gym)
group by e.g_code
order by (sum(timediff(clock_out, clock_in)) / 10000) * wage desc;

CREATE VIEW Sum_balance AS
select concat(B.fname, " ", B.lname) as "Member name", concat("$", convert(format(sum(amount), 2) using utf8))
from member B join payment P on B.mem_id = P.mem_id
where B.mem_id NOT IN (select mem_id
                       from payment
                       where type = "check")
group by B.mem_id;

CREATE VIEW Manager_and_Employees AS
select e.g_code as "Gym",
concat(e.EMP_Lname, ", ", e.EMP_Fname) as "Manager Name", concat(s.EMP_Lname, ", ", s.EMP_Fname) as "Employee Name"
from employee e left join employee s on s.ReportsTo = e.emp_id
where e.ReportsTo is null 
	and s.ReportsTo is not null 
order by e.g_code, e.EMP_Lname, e.EMP_Fname, s.EMP_Lname, s.EMP_Fname;

